  var input = $('input[type="number"]').each(function () {
    var $input = $(this),
        $parent = $input.parent().addClass('input-number'),
        div = document.createElement('div'),
        $btnUp = $(div),
        $btnDown = $(div).clone(),
        min = $input.attr('min'),
        max = $input.attr('max');

    $btnUp.addClass('input-number__up');
    $btnDown.addClass('input-number__down');
    $parent.prepend($btnDown, $btnUp);
    // $parent.prepend($btnDown).append($btnUp);


    $btnUp.click(function() {
      var oldValue = parseFloat($input.val()),
          newVal = 0;
      console.log($input);
      if (oldValue >= max) {
        newVal = oldValue;
      } else {
        newVal = oldValue + 1;
      }
      $input.val(newVal);
      $input.trigger("change");
    });

    $btnDown.click(function() {
      var oldValue = parseFloat($input.val()),
          newVal = 0;
      console.log($input);
      if (oldValue <= min) {
        newVal = oldValue;
      } else {
        newVal = oldValue - 1;
      }
      $input.val(newVal);
      $input.trigger("change");
    });
  });

